import React, {Component} from "react";
import {Link} from "react-router-dom";

class BookmarkItem extends Component {
    render() {
        const {bookmark} = this.props;
        return (
            <tr>
                <td>{bookmark.name}</td>
                <td>{bookmark.rating}</td>
                <td>
                    <form>
                        <Link to={"/updateBookmark/{bookmark.id}"}>
                            <button className="btn btn-outline-warning m-1"><i className="fa fa-fw fa-edit"></i></button>
                        </Link>
                        <Link to={""}>
                            <button className="btn btn-outline-danger"><i className="fa fa-fw fa-trash"></i></button>
                        </Link>
                    </form>
                </td>
            </tr>
        );
    }
}

export default BookmarkItem;
